import React from 'react';
import './App.css';
import Accueil from './pages/accueil' 
import Onglet from './composant/Onglet'
import './images/en'

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <nav>
          <Onglet/>
        </nav>

      </header>
      <div>
        <Accueil/>
      </div>
    </div>
  );
}

export default App;
